webpackJsonp([0x87e81a324e68],{5003:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/01/crh0122.jpg" height="400" width="300" border="0" alt="crh0122.jpg: " /></p>\n<p>Note the wardrobe composed in primary colors so that color-blind Papa can recognize his son\'s clothes.</p>\n<p>Christopher is going to his first party this evening. Anke from work moved out of the city to the country near us last November, and is having a combination birthday/housewarming party. Mama said that Christopher travelled so well yesterday (visiting and shopping), that we could put in a brief appearance</p>\n<p>Starting today, we have something at home that folks in the US take for granted: flatrate Internet access. Up to now we\'ve always had to pay for the local phone call, 3 to 6 pfennigs per minute. Now there are flatrates available nationwide for around DM 150 a month.</p>',fields:{title:"Christopher Goes Partying",date:"22 Jan 2000",url:"https://papascott.de/2000-01-22-christopher-goes-partying/"}}},pathContext:{slug:"/2000-01-22-christopher-goes-partying/",prev:{fields:{title:"Call Me Mr. Pacifier",date:"20 Jan 2000",slug:"/2000-01-20-call-me-mr-pacifier/"}},next:{fields:{title:"Sunday Walk",date:"23 Jan 2000",slug:"/2000-01-23-sunday-walk/"}}}}}});
